import{_ as r,c as t,q as a,o}from"./chunks/framework.BRsttz9t.js";const i="/assets/starter-01.BQhXy2TN.png",l="/assets/starter-02.Bf2WfiHX.png",n="/assets/starter-03.BOZeuzfN.png",s="/assets/starter-04.zLBRTWXy.png",h="/assets/starter-05.B8V6TaI0.png",g="/assets/starter-06.CtTR9ub7.png",c="/assets/starter-07.CmzgjHu_.png",u="/assets/starter-08.BWHELzJ3.png",f="/assets/starter-11.jq6tV3JA.png",y=JSON.parse('{"title":"新征程 ⛵️ ｜飞桨「启航计划」集训营圆满落幕","description":"","frontmatter":{"title":"新征程 ⛵️ ｜飞桨「启航计划」集训营圆满落幕","date":"2024-2-18","author":{"name":"孙钟恺","github":"sunzhongkai588"},"category":"community-activity"},"headers":[],"relativePath":"posts/starter-camp.md","filePath":"posts/starter-camp.md"}'),b={name:"posts/starter-camp.md"};function d(p,e,m,_,k,P){return o(),t("div",null,[...e[0]||(e[0]=[a('<p>在 2023 年的 11 月 14 日，飞桨开源社区开启了一个新项目（<s>新坑</s>）—— <strong>启航计划集训营</strong>。经过为期两个月紧张而充实的集训后，启航计划集训营于 1 月 30 日 正式圆满完成所有集训计划。在集训期间，大家出色地完成了三项热身打卡任务，并且有 <strong>19</strong> 位营员合入了超过 <strong>110</strong> 个 PR。衷心感谢各位营员的积极参与和卓越贡献！在这里，也向开源社区的各位 <strong>“汇报”</strong> 一下活动情况～</p><h2 id="_01-启航计划是什么" tabindex="-1">01 - 启航计划是什么？ <a class="header-anchor" href="#_01-启航计划是什么" aria-label="Permalink to &quot;01 - 启航计划是什么？&quot;">​</a></h2><p>「启航计划」 是飞桨社区发起的<strong>远程代码集训项目</strong>，也是「<a href="https://github.com/PaddlePaddle/Paddle/issues/61006" target="_blank" rel="noreferrer">护航计划</a>」的前置活动。我们以开展为期 2 个月集训营的形式，鼓励开发者积极参与开发 2 个方向的<strong>快乐开源任务</strong>，以此提升自己的代码实践能力，与社区共同成长 💪。</p><ul><li><a href="https://github.com/PaddlePaddle/Paddle/issues/56689" target="_blank" rel="noreferrer">基础方向</a>：Paddle 核心框架 + Paddle CV 套件的快乐开源任务，将有机会参与社区里最轻松愉快的开源开发活动。</li><li><a href="https://github.com/PaddlePaddle/PaddleMIX/issues/272" target="_blank" rel="noreferrer">大模型方向</a>：参与 PaddleMIX 跨模态大模型套件的快乐开源任务，将有机会接触社区里最前沿的大模型应用开发与工具建设。</li></ul><blockquote><p>活动详情见 Issue： <a href="https://github.com/PaddlePaddle/Paddle/issues/58497" target="_blank" rel="noreferrer">#58497</a></p></blockquote><p><img src="'+i+'" alt="starter-01"></p><h3 id="与护航计划的区别" tabindex="-1">与护航计划的区别？ <a class="header-anchor" href="#与护航计划的区别" aria-label="Permalink to &quot;与护航计划的区别？&quot;">​</a></h3><ul><li>不限定开发者背景，企业和学生开发者均可参与。</li><li>不进行面试，直接进行<strong>简历筛选</strong>。</li><li>集训内容为完成 <strong>【快乐开源任务】</strong>，合入 1 个 PR 即满足结营条件，相对轻松。</li><li>提供<strong>高质量集训课程</strong>，并以 PR review 交流的形式进行沟通，而非导师一对一带教的形式。</li><li>时间周期更短（2 个月），门槛相对更低。</li></ul><h3 id="参与者需要做什么" tabindex="-1">参与者需要做什么？ <a class="header-anchor" href="#参与者需要做什么" aria-label="Permalink to &quot;参与者需要做什么？&quot;">​</a></h3><h4 id="_1-自选任务-并投递简历报名-通过筛选后即可入营。集训营持续-2-个月-上限-30-人" tabindex="-1">1. 自选任务，并投递简历报名，通过筛选后即可入营。集训营持续 2 个月，上限 30 人 <a class="header-anchor" href="#_1-自选任务-并投递简历报名-通过筛选后即可入营。集训营持续-2-个月-上限-30-人" aria-label="Permalink to &quot;1. 自选任务，并投递简历报名，通过筛选后即可入营。集训营持续 2 个月，上限 30 人&quot;">​</a></h4><ul><li>共有 36 名候选人参与报名并投递简历。内部筛选后，最终通过 29 位学员。</li><li>入选学员中，22 名学生（电子科大、西交、杭电、浙大、清华……）、7 名企业开发者。</li><li>入选学员中，13 名 PFCC 成员，16 名新人。</li></ul><blockquote><p>入选营员：<a href="https://github.com/NKNaN" target="_blank" rel="noreferrer">@NKNaN</a>、<a href="https://github.com/shiofjsaio" target="_blank" rel="noreferrer">@shiofjsaio</a>、<a href="https://github.com/YangWulve" target="_blank" rel="noreferrer">@YangWulve</a>、<a href="https://github.com/Hhankyangg" target="_blank" rel="noreferrer">@Hhankyangg</a>、<a href="https://github.com/sanbuphy" target="_blank" rel="noreferrer">@sanbuphy</a>、<a href="https://github.com/Atlantisming" target="_blank" rel="noreferrer">@Atlantisming</a>、<a href="https://github.com/GreatV" target="_blank" rel="noreferrer">@GreatV</a>、<a href="https://github.com/Tsaiyue" target="_blank" rel="noreferrer">@Tsaiyue</a>、<a href="https://github.com/Kaedeharai" target="_blank" rel="noreferrer">@Kaedeharai</a>、<a href="https://github.com/wyyang23" target="_blank" rel="noreferrer">@wyyang23</a>、<a href="https://github.com/jiongjiongli" target="_blank" rel="noreferrer">@jiongjiongli</a>、<a href="https://github.com/rhmaaa" target="_blank" rel="noreferrer">@rhmaaa</a>、<a href="https://github.com/cocoshe" target="_blank" rel="noreferrer">@cocoshe</a>、<a href="https://github.com/zbt78" target="_blank" rel="noreferrer">@zbt78</a>、<a href="https://github.com/YibinLiu666" target="_blank" rel="noreferrer">@YibinLiu666</a>、<a href="https://github.com/Turingg" target="_blank" rel="noreferrer">@Turingg</a>、<a href="https://github.com/ooooo-create" target="_blank" rel="noreferrer">@ooooo-create</a>、<a href="https://github.com/ccsuzzh" target="_blank" rel="noreferrer">@ccsuzzh</a>、<a href="https://github.com/zade23" target="_blank" rel="noreferrer">@zade23</a>、<a href="https://github.com/challengewly" target="_blank" rel="noreferrer">@challengewly</a>、<a href="https://github.com/zoey333" target="_blank" rel="noreferrer">@zoey333</a>、<a href="https://github.com/unicornshell" target="_blank" rel="noreferrer">@unicornshell</a>、<a href="https://github.com/storm-ice" target="_blank" rel="noreferrer">@storm-ice</a>、<a href="https://github.com/YinKeYu" target="_blank" rel="noreferrer">@YinKeYu</a>、<a href="https://github.com/Olive-2019" target="_blank" rel="noreferrer">@Olive-2019</a>、<a href="https://github.com/fsczz" target="_blank" rel="noreferrer">@fsczz</a>、<a href="https://github.com/jiangziyan-693" target="_blank" rel="noreferrer">@jiangziyan-693</a>、<a href="https://github.com/isLinXu" target="_blank" rel="noreferrer">@isLinXu</a>、<a href="https://github.com/jingsongliujing" target="_blank" rel="noreferrer">@jingsongliujing</a></p></blockquote><h4 id="_2-按兴趣参与集训课程-一周一次-并按时提交双周周报" tabindex="-1">2. 按兴趣参与集训课程（一周一次）并按时提交双周周报 <a class="header-anchor" href="#_2-按兴趣参与集训课程-一周一次-并按时提交双周周报" aria-label="Permalink to &quot;2. 按兴趣参与集训课程（一周一次）并按时提交双周周报&quot;">​</a></h4><ul><li>以实际开发为导向，每周开展一次课程，总计安排 6 次课程。</li><li>营员每双周提交一次周报，追踪集训进展和计划，总计提交 4 期双周报。</li></ul><div style="display:flex;justify-content:space-between;"><figure style="width:50%;"><img src="'+l+'" alt="课程"><figcaption>课程以腾讯会议形式开展</figcaption></figure><figure style="width:46%;"><img src="'+n+'" alt="周报"><figcaption>周报截图</figcaption></figure></div><h4 id="_3-完成-3-个打卡任务-并至少合入-1-个快乐开源-pr" tabindex="-1">3. 完成 3 个打卡任务，并至少合入 1 个快乐开源 PR <a class="header-anchor" href="#_3-完成-3-个打卡任务-并至少合入-1-个快乐开源-pr" aria-label="Permalink to &quot;3. 完成 3 个打卡任务，并至少合入 1 个快乐开源 PR&quot;">​</a></h4><ul><li>打卡任务一：修改飞桨文档。25 人完成</li><li>打卡任务二：Paddle 本地编译。13 人完成</li><li>打卡任务三：跑通 SD 训练推理。15 人完成</li></ul><div style="display:flex;justify-content:center;"><figure style="width:70%;"><img src="'+s+'" alt="打卡"><figcaption>热身任务打卡情况（部分）</figcaption></figure></div><h4 id="_4-结营期间-可自愿申请一、二、三等奖-并参加答辩" tabindex="-1">4. 结营期间，可自愿申请一、二、三等奖，并参加答辩 <a class="header-anchor" href="#_4-结营期间-可自愿申请一、二、三等奖-并参加答辩" aria-label="Permalink to &quot;4. 结营期间，可自愿申请一、二、三等奖，并参加答辩&quot;">​</a></h4><ul><li>共有 3 位营员申请（<a href="https://github.com/zbt78" target="_blank" rel="noreferrer">@zbt78</a>、<a href="https://github.com/Tsaiyue" target="_blank" rel="noreferrer">@Tsaiyue</a>、<a href="https://github.com/ooooo-create" target="_blank" rel="noreferrer">@ooooo-create</a>），并均顺利通过一、二、三等奖答辩。</li><li>一、二等奖获得者（<a href="https://github.com/zbt78" target="_blank" rel="noreferrer">@zbt78</a>、<a href="https://github.com/Tsaiyue" target="_blank" rel="noreferrer">@Tsaiyue</a>）当场<strong>入选护航计划集训营</strong>。</li></ul><blockquote><p>结营考核详情见 Issue：<a href="https://github.com/PFCCLab/Starter/issues/123" target="_blank" rel="noreferrer">#123</a></p></blockquote><div style="display:flex;justify-content:center;"><figure style="width:70%;"><img src="'+h+'" alt="答辩"><figcaption>答辩现场</figcaption></figure></div><h3 id="飞桨官方提供什么" tabindex="-1">飞桨官方提供什么？ <a class="header-anchor" href="#飞桨官方提供什么" aria-label="Permalink to &quot;飞桨官方提供什么？&quot;">​</a></h3><h4 id="_1-开发导向的每周课程" tabindex="-1">1. 开发导向的每周课程 <a class="header-anchor" href="#_1-开发导向的每周课程" aria-label="Permalink to &quot;1. 开发导向的每周课程&quot;">​</a></h4><ul><li>由飞桨研发和 PM 根据营员的诉求和实际开发情况，来提供每周的课程。</li></ul><div style="display:flex;justify-content:center;"><figure style="width:60%;"><img src="'+g+'" alt="课程"><figcaption>课程安排</figcaption></figure></div><h4 id="_2-周报管理" tabindex="-1">2. 周报管理 <a class="header-anchor" href="#_2-周报管理" aria-label="Permalink to &quot;2. 周报管理&quot;">​</a></h4><ul><li>助教负责对每双周的周报进行管理，确保提交周报的数量和质量。</li></ul><div style="display:flex;justify-content:center;"><figure style="width:60%;"><img src="'+c+'" alt="周报截图"><figcaption>其中一期周报提及截图</figcaption></figure></div><h4 id="_3-技术答疑" tabindex="-1">3. 技术答疑 <a class="header-anchor" href="#_3-技术答疑" aria-label="Permalink to &quot;3. 技术答疑&quot;">​</a></h4><ul><li>在微信群以及课程中，飞桨研发会针对营员的疑惑进行一一解答。</li><li>同时，会有热心、能力强的营员解答别人的问题。</li></ul><h4 id="_4-活动运营支持" tabindex="-1">4. 活动运营支持 <a class="header-anchor" href="#_4-活动运营支持" aria-label="Permalink to &quot;4. 活动运营支持&quot;">​</a></h4><ul><li>PM 和助教会对活动的各个环节提供支持，保障整体活动的顺利进行。</li></ul><div style="display:flex;justify-content:center;"><figure style="width:60%;"><img src="'+u+'" alt="活动安排"><figcaption>整体活动节奏</figcaption></figure></div><h4 id="_5-成绩评估" tabindex="-1">5. 成绩评估 <a class="header-anchor" href="#_5-成绩评估" aria-label="Permalink to &quot;5. 成绩评估&quot;">​</a></h4><ul><li>PM 和助教会根据结营要求，在结营期间对每位学员进行评估，判断是否满足结营条件。</li><li>针对一、二、三等奖的答辩，会邀请相应方向的研发导师进行评估。同时，这也是进入<strong>护航计划的绝佳机会</strong>，因为研发导师会有充足的时间来了解你～</li></ul><h2 id="_02-活动成果" tabindex="-1">02 - 活动成果 <a class="header-anchor" href="#_02-活动成果" aria-label="Permalink to &quot;02 - 活动成果&quot;">​</a></h2><h3 id="数字上的成果" tabindex="-1">数字上的成果 <a class="header-anchor" href="#数字上的成果" aria-label="Permalink to &quot;数字上的成果&quot;">​</a></h3><ol><li>共有 <strong>19</strong> 位营员合入了超过 <strong>110</strong> 个快乐开源 PR。</li><li>社区新加入 <strong>11</strong> 名 contributor。</li><li><strong>15</strong> 名营员成功通过考核、顺利结营，<strong>2</strong> 名优秀营员入选护航计划。</li><li><a href="https://github.com/cocoshe" target="_blank" rel="noreferrer">@cocoshe</a> 在开发过程中沉淀 1 篇<a href="https://github.com/PaddlePaddle/community/blob/master/pfcc/paddle-code-reading/PHI_kernel_registration/PHI_kernel_registration.md" target="_blank" rel="noreferrer">《 PHI 算子库 kernel 注册全流程源码阅读》</a>。</li></ol><h3 id="数字背后的情况" tabindex="-1">数字背后的情况 <a class="header-anchor" href="#数字背后的情况" aria-label="Permalink to &quot;数字背后的情况&quot;">​</a></h3><blockquote><ol><li>共有 <strong>19</strong> 位营员合入了超过 <strong>110</strong> 个快乐开源 PR。</li></ol></blockquote><p>完成 80+ 文档、15+ 新 IR 适配、15+ 静态图推全、 5+ cmake 治理、 5+ 复数算子等等题目，文档相关任务约占总体完成任务的一半左右.</p><blockquote><ol start="2"><li>社区新加入 <strong>11</strong> 名 contributor。</li></ol></blockquote><p>其中 7 名 contributor 只合入了一个文档相关 PR，活动后续缺少延续性。</p><blockquote><ol start="3"><li><strong>15</strong> 名营员成功通过考核、顺利结营，<strong>2</strong> 名优秀营员入选护航计划。</li></ol></blockquote><p>考核通过的营员中，有 10 名是原 PFCC 成员，纯新人通过率不高（31%），猜测是启航计划的活动缺乏引导。</p><h2 id="_03-新的尝试——docs-偶像女团-精品小团" tabindex="-1">03 - 新的尝试——Docs 偶像女团（精品小团） <a class="header-anchor" href="#_03-新的尝试——docs-偶像女团-精品小团" aria-label="Permalink to &quot;03 - 新的尝试——Docs 偶像女团（精品小团）&quot;">​</a></h2><h3 id="是什么" tabindex="-1">是什么？ <a class="header-anchor" href="#是什么" aria-label="Permalink to &quot;是什么？&quot;">​</a></h3><p>自愿参与文档开发、维护的社区化小团体，氛围活跃，开发意愿很积极。</p><h3 id="由谁组成" tabindex="-1">由谁组成？ <a class="header-anchor" href="#由谁组成" aria-label="Permalink to &quot;由谁组成？&quot;">​</a></h3><ol><li>3 名大二女生（2 名启航计划学员 <a href="https://github.com/Turingg" target="_blank" rel="noreferrer">@Turingg</a> <a href="https://github.com/Kaedeharai" target="_blank" rel="noreferrer">@Kaedeharai</a>，1 名社区开发者<a href="https://github.com/entired" target="_blank" rel="noreferrer">@entired</a>），主要负责开发和维护。</li><li>1 名热心社区开发者（<a href="https://github.com/ooooo-create" target="_blank" rel="noreferrer">O 师傅</a>，大三），负责日常手把手指导 3 名女生。</li><li>2 名飞桨内部同学，负责维持团体运转、答疑解惑。</li></ol><h3 id="为什么组成这个团体" tabindex="-1">为什么组成这个团体？ <a class="header-anchor" href="#为什么组成这个团体" aria-label="Permalink to &quot;为什么组成这个团体？&quot;">​</a></h3><p>集训期间，2 位女生开发意愿比较强烈，但对具体做什么事情感到迷茫，因此孙师傅就把她们拉入（<s>骗进</s>）了 docs 小组。</p><h3 id="运转机制" tabindex="-1">运转机制？ <a class="header-anchor" href="#运转机制" aria-label="Permalink to &quot;运转机制？&quot;">​</a></h3><ul><li><strong>每周一次例会</strong>，由 3 名女生轮流主持，主要通过每周开发进度、布置新任务，所有人必须参会。</li><li><strong>每周一次会议纪要</strong>，由会议主持负责写会议内容和 Todo。</li><li><strong>如流群日常沟通交流</strong>。</li></ul><p><img src="'+f+'" alt="starter-11"></p><blockquote><p>详细资料见：<a href="https://github.com/PFCCLab/Starter/tree/main/community/docs_group" target="_blank" rel="noreferrer">community/docs_group</a></p></blockquote>',57)])])}const x=r(b,[["render",d]]);export{y as __pageData,x as default};
